import React, { useState } from "react";
import { APIProvider, Map, Marker } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";

const AddProperty = () => {
    const [markers, setMarkers] = useState([]);
    const [hideBlocks, setHideBlocks] = useState(false);

    const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

    const toggleBlocks = () => {
        setHideBlocks(!hideBlocks);
    };

    const clearOutput = () => {
        const name = document.getElementById('Property_Name');
        const phone = document.getElementById('Phone_No');
        const email = document.getElementById('Email_Address');
        const password = document.getElementById('Password');

        if (!email.value && !password.value && !name.value && !phone.value) {
            name.value = "";
            phone.value = "";
            email.value = "";
            password.value = "";
        }
    };

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <>
                <nav className="db dt-l w-100 tr border-box ph5-l bg-dark-blue">
                    <button className="dtc-l v-mid black dim b--none bg-transparent tl-l" title="Home">
                        <img src="https://www.wikipedia.org/portal/wikipedia.org/assets/img/Wikipedia-logo-v2.png" className="br-100 ba h2 w2 dib v-mid" alt="Student logo" />
                        Landlord@gmail.com
                    </button>
                </nav>

                <article className="cf">
                    <div className={hideBlocks ? "dn" : "fl w-20 bg-navy vh-100 tc"} id="column_one">
                        <div>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/LandlordDashboard" title="LandlordDashboard">Dashboard</Link>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/LandlordProfile" title="LandlordProfile">Profile</Link>
                            <Link className="link f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" to="/AddProperty" title="AddProperty">AddProperty</Link>
                            <a className="f6 f3-ns fw6 tc mt4 db white no-underline underline-hover" href="#0">Log Out</a>
                        </div>
                    </div>
                    <div className={hideBlocks ? "fl w-100 bg-light-gray vh-100" : "fl w-80 bg-light-gray vh-100"} id="column_two">
                        <div>
                            <button className="f6 br2 ph3 pv2 mb2 dib black bg-light-gray" onClick={toggleBlocks}>{hideBlocks ? "Show Blocks" : "Hide Blocks"}</button>
                            <h1 className="ma0 ml4 center tc">Add New Property</h1>
                        </div>
                        <div>
                            <article className="black-80 w-100 tc">
                                <form>
                                    {/* Form fields */}
                                </form>
                            </article>
                        </div>
                    </div>
                </article>
                <footer className="bottom-0 w-100 ph3 ph5-m ph6-l bg-light-gray z-9999">
                    <small className="f6 db tc">Â©<b className="ttu">Created by Group CB</b>., All Rights Reserved</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default AddProperty;
